INSERT INTO `jawaban` (`id`, `id_m_pertanyaan`, `id_m_pengguna`, `teks`, `pinned`, `vote_up`, `vote_down`, `user_vote`, `created_at`, `updated_at`) VALUES
(74, 3, 15, '<div>&nbsp;Tugas Bebras singkat harus melibatkan konsep informatika seperti algoritma dan program: berurutan dan konkuren; struktur data seperti tumpukan, tumpukan, dan antrian; pemodelan keadaan, aliran kontrol dan aliran data; interaksi manusia-komputer; grafik; dll. Jika pernyataan masalah yang tepat digunakan, maka hampir semua aspek ilmu komputer dan teknologi informasi dapat menjadi topik tugas Bebras. Serangkaian tugas dan pertanyaan baru dikembangkan dalam lokakarya internasional&nbsp;tahunan&nbsp;Bebras.</div>', 0, 1, 1, NULL, '2023-06-20 18:27:22', '2023-06-21 00:32:55');
